import React from 'react'

import { Map, Marker, GoogleApiWrapper } from 'google-maps-react'

const GoogleMap = (props) => {
    return (
        <>
            <Map
            google={this.props.google}
            style={customizeMap}
            zoom={6}
            initialCenter={{ 
                lat: 9.96233, 
                lng: 49.80404
            }}>
            {this.drawMarker()}
            </Map>
        </>
    )
}

export default GoogleMap
